import bisect


class Solution:
    def minWastedSpace(self, packages, boxes) -> int:
        MOD = 10 ** 9 + 7
        packages.sort()
        package_sum = [0] * (len(packages) + 1)
        current_sum = 0
        for i in range(len(packages)):
            current_sum += packages[i]
            package_sum[i] = current_sum

        wastage = float('inf')

        for box in boxes:
            last_boxed_package = -1
            current_wastage = 0
            box.sort()
            for capacity in box:
                index = bisect.bisect_right(packages, capacity)
                packages_box_can_box = index - 1 - last_boxed_package
                current_wastage += packages_box_can_box * capacity - (package_sum[index - 1] - package_sum[last_boxed_package])
                last_boxed_package = index - 1
                if index == len(packages):
                    break
            if last_boxed_package == len(packages) - 1:
                wastage = min(wastage, current_wastage)

        return wastage % MOD if wastage != float('inf') else -1


